import React from 'react'
import logo from './images/Podnet1.png'
import './Sidebar.css'

function Content() {
    return (
        <div>
            <div>
                <img src={logo} alt="logo" height="100px" width="100px" class="logo-opacity"/>
            </div>
        </div>
    )
}

export default Content;
